package hr.fer.zemris.apr.lab05.demo;import hr.fer.zemris.apr.lab05.matrix.Matrix;import hr.fer.zemris.apr.lab05.solver.ISolver;import hr.fer.zemris.apr.lab05.solver.RungeKutta;import hr.fer.zemris.apr.lab05.solver.Trapezni;import javax.swing.plaf.basic.BasicInternalFrameTitlePane;import java.util.List;public class Task3 {    public static void main(String[] args) {        Matrix A = new Matrix(new double[][]{                {0, 1},                {-1, -1}        });        Matrix B = new Matrix(new double[][]{                {0},                {0}        });        Matrix x0 = new Matrix(new double[][]{                {0},                {1}        });        ISolver kutta = new RungeKutta();        List<Matrix> kuttaResults = kutta.calculate(A, B, x0, 0.1, 30);        ISolver trapezni = new Trapezni();        List<Matrix> trapezniResults = trapezni.calculate(A, B, x0, 0.1, 30);    }}